package pdpodev4;

import java.math.BigInteger;     //Buyuk sayilar icin BigInteger kutuphanesi 

import java.util.concurrent.ExecutorService;

import java.util.concurrent.Executors;

import java.io.*;                //Dosya islemleri icin gerekli kutuphaneler

public class PdpOdev4 
{

    public static void main(String[] args) throws IOException 
    {
        
        String randNumb="";
        //1.sayi bigInteger turunde
        BigInteger num1 = new BigInteger(randNumb);
        //2.sayi String 
        String num2 = "";           
           // milisaniyelerle detayl sonnuc analizi icin long tipinde degisken
         
        long baslangic = System.nanoTime(); //Sistem saatini cekmek icin nanotime kullandk
           //slem snfndan 4 adet nesne olusturduk 
        islem deneme1=new islem(num1,num2,0,1); 
         
        islem deneme2=new islem(num1,num2,1,2);
         
        islem deneme3=new islem(num1,num2,2,3);
         
        islem deneme4=new islem(num1,num2,3,4);
       
        //ExecutorService ile bir thread havuzu olusturduk 
        //Havuza 4 adet thread gndeririz
        ExecutorService havuz = Executors.newFixedThreadPool(20);
        
        havuz.submit(deneme1);
        havuz.submit(deneme2);
        havuz.submit(deneme3);
        havuz.submit(deneme4);
          
        havuz.shutdown(); //Havuz islemlerini sonlandr
           
        while(!havuz.isTerminated())// Sre hesabnn doru ckmas icin havuzun bitmesi beklenir
        {
               
        }
            
        long bitis = System.nanoTime();//hesaplama bitiyor
           
        double sure = (bitis-baslangic)/1000000.0;
            
        System.out.println("\nParalel Hesaplanma Sresi " + String.format("%.2f", sure) + " milisaniye.\n");
     
        BigInteger sonuc = deneme2.getSonuc().add(deneme1.getSonuc().add(deneme3.getSonuc().add(deneme4.getSonuc())));
        // 4 farkl thread'lerden gelen sonuclar 1 degiskende toplanr
        baslangic = System.nanoTime(); 
           
        //Seri carpma islemi 
        Carp c = new Carp(num1,num2);
           
        c.carp();
           
        bitis = System.nanoTime();//hesaplama bitiyor
           
        sure = (bitis-baslangic)/1000000.0;
           
        System.out.println("\nSeri Hesaplanma Sresi " + String.format("%.2f", sure) + " milisaniye.");
        
        try
        {
            //Dosya yaz
            BufferedWriter writer = new BufferedWriter(new FileWriter("Yaz.txt"));

            writer.write(String.valueOf(sonuc));  //Sonucu dosyaya yazdrr

            System.out.println("Sonuc dosayaya yazildi.");
            // System.out.println(sonuc);
            writer.close(); //Dosya kapatlyor1
        }
        catch(IOException ex)
        {
            System.out.println(ex.getMessage());
        }
    
    }    
}
